        return placeholder;
    }

    return (
        <div className="dropdown">
            <div className="dropdown--input">
                <div className="dropdown--selectedValue">{getDisplay()}</div>
                <CaretDown size={16} />
            </div>
            <div className="dropdown--menu"><
                /div>
        </div>
    )
}
